import React from "react";
import ConfigFooter from '../capas/footer/footer';
import Form from "../capas/formulario/formulario";
import '../componentes/contacto.css'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';



const NavBarDefault = () => {
        return(

            <div className='mainDivNav'>
        <Navbar className="nav" variant="dark" expand="lg">
          <Container>
            <Navbar.Brand href=""> </Navbar.Brand>
            <Navbar.Toggle className="menu"aria-controls="basic-navbar-nav"/>
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="navigating" >
                <Nav.Link className='inicio' href="/">Inicio</Nav.Link>
                <Nav.Link className='contacto'href="/contacto">Contacto</Nav.Link>
                <Nav.Link className='curriculum'href="/cv">Curriculum</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
</div>


        )
}

const ConfigHeadContacto = ()  => {
        return(
            
<div className="mainDivHead">
        <head>
            <title> Pagina Oficial </title>
        </head>
        <header className = "flex_header">
            <div>
                <h1 className="gg">GG</h1>
            </div>
            <div className="contenedor">
              <NavBarContacto/>
            </div>
            
        </header>
    </div>
        )
}


const Contacto = () =>  {
    return(
    <div>
        <ConfigHeadContacto/>        

        <Form/>
            
        <ConfigFooter/>
    </div>
    )
};



export default Contacto;
